import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 63.2-1206 No parental presumption after revocation period expires.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/63.2-1206.md","filePath":"vacode/63.2-1206.md"}'),o={name:"vacode/63.2-1206.md"},i=a('<h1 id="§-63-2-1206-no-parental-presumption-after-revocation-period-expires" tabindex="-1">§ 63.2-1206 No parental presumption after revocation period expires. <a class="header-anchor" href="#§-63-2-1206-no-parental-presumption-after-revocation-period-expires" aria-label="Permalink to &quot;§ 63.2-1206 No parental presumption after revocation period expires.&quot;">​</a></h1><p>If, after the expiration of the appropriate revocation period provided for in § <a href="http://law.lis.virginia.gov/vacode/63.2-1223/" target="_blank" rel="noreferrer">63.2-1223</a> or § <a href="http://law.lis.virginia.gov/vacode/63.2-1234/" target="_blank" rel="noreferrer">63.2-1234</a>, a birth parent or an alleged birth parent attempts to obtain or regain custody of or attempts to exercise parental rights to a child who has been placed for adoption, there shall be no parental presumption in favor of any party. Upon the motion of any such birth parent or alleged birth parent, or upon the motion of any person or agency with whom the child has been placed, the circuit or juvenile and domestic relations district court, as the case may be, shall determine (i) whether the birth parent or alleged birth parent is a person whose consent to the adoption is required and, if so, then (ii) pursuant to § <a href="http://law.lis.virginia.gov/vacode/63.2-1205/" target="_blank" rel="noreferrer">63.2-1205</a>, whether, in the best interest of the child, the consent of the person whose consent is required is being withheld contrary to the best interest of the child or is unobtainable.</p><p>1995, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0772" target="_blank" rel="noreferrer">772</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0826" target="_blank" rel="noreferrer">826</a>, § 63.1-220.7; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0830" target="_blank" rel="noreferrer">830</a>, § 63.1-219.14; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0467" target="_blank" rel="noreferrer">467</a>.</p>',3),n=[i];function p(l,s,h,c,d,f){return r(),t("div",null,n)}const v=e(o,[["render",p]]);export{_ as __pageData,v as default};
